import { XAxis, YAxis } from "react-stockcharts/lib/axes";
import { fitWidth } from "react-stockcharts/lib/helper";
import { last, timeIntervalBarWidth } from "react-stockcharts/lib/utils";
import { withRouter } from 'react-router-dom';
import { timeFormat } from "d3-time-format";
import {
    CrossHairCursor,
    EdgeIndicator,
    CurrentCoordinate,
    MouseCoordinateX,
    MouseCoordinateY
  } from "react-stockcharts/lib/coordinates";
function Graphh(props) {
   
    const [data, setData] = useState([]);
    const [width,setWidth] =useState()
    const [loading ,setLoding] = useState(false)
    
   
     
   
    useEffect(()=>{
        loopData(props.data.data.hcl);
       
    },[loading,props.data])
    
    const loopData = (hcl) => {
        
        var array = [];
        var OpenLen = hcl.Open.length;
        //props.data.data.
        for( var i = 0; i < OpenLen; i++){
            
            array.push({ date: new Date(hcl.opentime[i]),  open : hcl.Open[i], high: hcl.High[i], low : hcl.Low[i],close: hcl.Close[i],volume : hcl.Volume[i],buy2: props.data.data.ai.bigmome.BUY2[i],ambi: props.data.data.ai.bigmome.ambi[i]  ,amb0: props.data.data.ai.sell.amb0[i],amb1: props.data.data.ai.sell.amb1[i],amb2: props.data.data.ai.sell.amb2[i],amb3: props.data.data.ai.sell.amb3[i],amb99: props.data.data.ai.sell.amb99[i],amb13: props.data.data.ai.mome.amb13[i],amb14: props.data.data.ai.mome.amb14[i],
                amb15: props.data.data.ai.mome.amb15[i],amb55: props.data.data.ai.mome.amb55[i],ci: props.data.data.ai.smallmome.ci[i],amo: props.data.data.ai.smallmome.amo[i],
                ambb: props.data.data.ai.buy.ambb[i],rsik: props.data.data.formula.rsiK[i],ambb5: props.data.data.ai.buy.ambb5[i],ww6: props.data.data.ai.buy.ww6[i],ww7: props.data.data.ai.buy.ww7[i] })
        }
        setData(array)
        setWidth(window.innerWidth)
        setLoding(true)
        
        
    }
    window.addEventListener("resize", function() {
        setWidth(window.innerWidth)
    });
    // console.log(new Date(props.data.data.hcl.opentime[0]))
  
    const xAccessor = (d) => {
        if (d != null){
          
            return d.date
        }
      }
  
    const xExtents = [
        xAccessor(last(data)),
        xAccessor(data[data.length - 250])
    ];

    return (
        <div>
       	   {loading  ?<ChartCanvas  className ="aa"   height={945}
                    margin={{left: 70, right: 70, top:10, bottom: 30}}
					width={width}
                    ratio ={200}
					type={"svg"}
					seriesName="MSFT"
					data={data}
					xAccessor={d =>  d.date}
					xScale={scaleTime()}
					xExtents={xExtents}
                  
                    >

				<Chart height={150} id={0} yExtents={d => [d.high, d.low]}
                 padding={{ top: 10, bottom: 10 }}>
                 
				
					<YAxis axisAt="left" orient="left" ticks={7} />
                    
					<CandlestickSeries width={timeIntervalBarWidth(utcHour.every(4))}/>
                    <OHLCTooltip origin={[10, 0]} />
                    
                    <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            outerTickSize={0}
          />
                     <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
				</Chart>
                
     
        <Chart
          id={1}
          yExtents={d =>  d.ambi }
          height={75}
  
          origin={(w, h) => [0, h - 725 ]}
          padding={{ top: 10, bottom: 10 }}
          
        >
         
          <YAxis axisAt="right" orient="right" ticks={2} />
    
          <LineSeries yAccessor={d =>  d.buy2} stroke = {"#283747"}   className ="col" />
          <LineSeries yAccessor={d =>  d.ambi} stroke = {"#657a00"}  />
      
          <SingleValueTooltip
                        className="col"
						yAccessor={d =>  d.buy2}
						yLabel={`BUY2`}
						yDisplayFormat={format(".2f")}
                        
	
                        
						origin={[-40, 3]}/>
              <SingleValueTooltip
						yAccessor={d =>  d.ambi}
						yLabel={`ambi`}
						yDisplayFormat={format(".2f")}
						className="col"
						
                      
						origin={[30, 3]}/>
                               <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            outerTickSize={0}
          />
                  <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
        <Chart
          id={2}
          yExtents={d =>  d.amb0 }
          height={90}
  
          origin={(w, h) => [0, h - 640 ]}
          padding={{ top: 10, bottom: 10 }}
        >
       
          <YAxis axisAt="right" orient="right" ticks={3} />
    
          <LineSeries yAccessor={d =>  d.amb0} stroke = {"#283747"}  />
          <LineSeries yAccessor={d =>  d.amb1} stroke = {"#657a00"}  />
          <LineSeries yAccessor={d =>  d.amb2} stroke = {"#FF4136"}  />
          <LineSeries yAccessor={d =>  d.amb3} stroke = {"#7FDBFF"}  />
          <LineSeries yAccessor={d =>  d.amb99} stroke = {"#B10DC9"}  />
          <SingleValueTooltip
						yAccessor={d =>  d.amb0}
						yLabel={`amb0`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
              <SingleValueTooltip
						yAccessor={d =>  d.amb1}
						yLabel={`amb1`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4684" - optional prop */
						origin={[30, 3]}/>
                          <SingleValueTooltip
						yAccessor={d =>  d.amb2}
						yLabel={`amb2`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[100, 3]}/>
                          <SingleValueTooltip
						yAccessor={d =>  d.amb3}
						yLabel={`amb3`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[170, 3]}/>
                          <SingleValueTooltip
						yAccessor={d =>  d.amb99}
						yLabel={`amb99`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[240, 3]}/>
                                  <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            outerTickSize={0}
            
          />
                 <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
           
        </Chart>
        <Chart
          id={3}
          yExtents={d =>  d.amb13 }
          height={100}
  
          origin={(w, h) => [0, h - 540 ]}
          padding={{ top: 20, bottom: 10 }}
        >
          
          <YAxis axisAt="right" orient="right" ticks={3} />
    
          <LineSeries yAccessor={d =>  d.amb13} stroke = {"#283747"}  />
          <LineSeries yAccessor={d =>  d.amb14} stroke = {"#657a00"}  />
          <LineSeries yAccessor={d =>  d.amb15} stroke = {"#FF4136"}  />
          <LineSeries yAccessor={d =>  d.amb55} stroke = {"#7FDBFF"}  />
          
          <SingleValueTooltip
						yAccessor={d =>  d.amb13}
						yLabel={`amb13`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
              <SingleValueTooltip
						yAccessor={d =>  d.amb14}
						yLabel={`amb14`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[30, 3]}/>
                          <SingleValueTooltip
						yAccessor={d =>  d.amb15}
						yLabel={`amb15`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[100, 3]}/>
                          <SingleValueTooltip
						yAccessor={d =>  d.amb55}
						yLabel={`amb55`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[170, 3]}/>
                                                      <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            outerTickSize={0}
          />
                   <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
        <Chart
          id={4}
          yExtents={d =>  d.ambb }
          height={100}
  
          origin={(w, h) => [0, h - 425 ]}
          padding={{ top: 10, bottom: 10 }}
        >
         
          <YAxis axisAt="right" orient="right" ticks={2} />
    
          <LineSeries yAccessor={d =>  d.ci} stroke = {"#283747"}  />
          <LineSeries yAccessor={d =>  d.amo} stroke = {"#657a00"}  />
          <LineSeries yAccessor={d =>  d.ambb} stroke = {"#FF4136"}  />
          <LineSeries yAccessor={d =>  d.rsik/100} stroke = {"#B10DC9"}  />
          
          <SingleValueTooltip
						yAccessor={d =>  d.ci}
						yLabel={`ci`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
              <SingleValueTooltip
						yAccessor={d =>  d.amo}
						yLabel={`amo`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[30, 3]}/>
                    <SingleValueTooltip
						yAccessor={d =>  d.ambb}
						yLabel={`ambb`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[100, 3]}/>
                  
    
    <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            outerTickSize={0}
          />
                  <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
        <Chart
          id={5}
          yExtents={d =>  d.ambb5 }
          height={100}
  
          origin={(w, h) => [0, h - 310 ]}
          padding={{ top: 10, bottom: 10 }}
        >
         
          <YAxis axisAt="right" orient="right" ticks={3} />
    
          <LineSeries yAccessor={d =>  d.ambb5} stroke = {"#283747"}  />
          <LineSeries yAccessor={d =>  d.ww6} stroke = {"#657a00"}  />
          <LineSeries yAccessor={d =>  d.ww7} stroke = {"#FF4136"}  />

          
          <SingleValueTooltip
						yAccessor={d =>  d.ambb5}
						yLabel={`ambb5`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
              <SingleValueTooltip
						yAccessor={d =>  d.ww6}
						yLabel={`ww6`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[30, 3]}/>
            <SingleValueTooltip
						yAccessor={d =>  d.ww7}
						yLabel={`ww7`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[100, 3]}/>
            <XAxis axisAt="bottom" orient="bottom" />
            <MouseCoordinateX
            at="bottom"
            orient="bottom"
            displayFormat={timeFormat("%Y-%m-%d")}
          />
          <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
          <CrossHairCursor />
			</ChartCanvas> : ""}
        </div>
    )
}

export default Graphh
